string operator*(const string& s, unsigned int n){
    stringstream out;
    while(n--)
        out << s;
    return out.str();
}

string operator*(unsigned int n, const string& s){
    return  s * n;
}

int count_substring(string s, int ending, string target){
    int occurrences = 0;
    string::size_type pos = 0;

    while ((pos = s.find(target, pos)) < ending){
        //cout << pos << " " << ending << endl;
        ++occurrences;
        pos += target.length();
    }
    return occurrences;
}

int parallel_count(string s, string target, int ending, int threads){
    thread my_threads[128];
    for(int i=0;i<threads;i++)
        my_threads[i] = thread(count_substring, s, (ending/threads), target);
    for(int i=0;i<threads;i++)
        my_threads[i].join();
}
